r\n\r\nLorem ipsum dolor a sit ameti, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et incididunt ut labore et. Lorem ipsum dolor a sit ameti, consectetur adipisicing elit.\r\n\r\nLorem ipsum dolor a sit ameti, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et incididunt ut labore et. Lorem ipsum dolor a sit ameti, consectetur adipisicing elit.','Blog 4','','inherit','closed','closed','','93-revision-v1','','','2018-10-02 07:57:05','2018-10-02 00:57:05','',93,'http://localhost/wordpress/93-revision-v1/',0,'revision','',0),(95,1,'2018-10-02 07:57:38','2018-10-02 00:57:38','<div class=\"copy-paste-block\">\r\n\r\nRumah subsidi sejumlah 20.000 unit akan dibangun Pemerintah Kabupaten Bandung Barat bekerja sama dengan invrstor. Rumah subsidi ini khusus buat para buruh dan sudah masuk dalam Rencana Pembangunan Jangka Menengah Daerah Kabupaten Bandung Barat.\r\n\r\n\"Sekarang sudah mulai pembebasan lahan. Targetnya 200 hektare, sekarang kemungkinan sudah 50 hektare,” kata Bupati Bandung Barat, Aa Umbara Sutisna, seperti dikutip <em>pikiran-rakyat.com, </em>Selasa (2-10-2018).\r\n\r\nDia menyatakan, sudah berkomunikasi dengan calon investor pengembang rumah subsidi tersebut. Lokasinya di sekitar Padalarang dan Cipatat dengan harga Rp120 juta, cicilan Rp700.000 per bulan selama 15 tahun.\r\n\r\n“Kami targetkan akhir 2019 pembangunan sudah dimulai. Namun, selambat-lambatnya 2020 sudah berjalan,” kata Umbara.\r\n\r\nBaca juga: <strong><a title=\"Dengan DP Rp2,9 Juta dan Cicilan Ringan, Buruh Bisa Punya Hunian Juga Loh!\" href=\"https://artikel.rumah123.com/dengan-dp-rp29-juta-dan-cicilan-ringan-pekerja-bisa-beli-hunian-di-pp-urban-serpong-town-37159\">Dengan DP Rp2,9 Juta dan Cicilan Ringan, Buruh Bisa Punya Hunian Juga Loh!</a></strong>\r\n\r\nMenurutnya, saat ini 80% buruh belum punya rumah, mereka harus mengeluarkan uang untuk bayar kontrakan. Nah, dengan program rumah subsidi ini, maka mereka bisa mengalihkan uang kontrakan rumah untuk cicilannya. Setiap bulan mereka keluar uang untuk cicilan, tapi pada akhirnya mereka jadi punya rumah.\r\n\r\nKepala Dinas Tenaga Kerja dan Transmigrasi Kabupaten Bandung Barat, Iing Solihin, dikutip dari sumber yng sama, mengatakan, saat ini tercatat ada sekitar 62.000 buruh di Bandung Barat yang 80%-nya belum punya rumah.\r\n\r\nSedangkan Ketua Serikat Pekerja Nasional Kabupaten Bandung Barat, Budiman, atas nama buruh menyambut baik program rumah subsidi ini. Pihaknya akan terus mengawal proses hingga permahan subsidi buat para buruh ini terealisasi.\r\n\r\n</div>','Bakal Ada 20.000 Unit Rumah Subsidi Para Buruh di Bandung Barat','','publish','open','open','','blog-5','','','2018-10-06 11:50:14','2018-10-06 04:50:14','',0,'http://localhost/wordpress/?p=95',0,'post','',11),(96,1,'2018-10-02 07:57:38','2018-10-02 00:57:38','Lorem ipsum dolor a sit ameti, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et incididunt ut labore et. Lorem ipsum dolor a sit ameti, consectetur adipisicing elit.\r\n\r\nLorem ipsum dolor a sit ameti, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et incididunt ut labore et. Lorem ipsum dolor a sit ameti, consectetur adipisicing elit.\r\n\r\nLorem ipsum dolor a sit ameti, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et incididunt ut labore et. Lorem ipsum dolor a sit ameti, consectetur adipisicing elit.\r\n\r\nLorem ipsum dolor a sit ameti, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et incididunt ut labore et. Lorem ipsum dolor a sit ameti, consectetur adipisicing elit.','Blog 5','','inherit','closed','closed','','95-revision-v1','','','2018-10-02 07:57:38','2018-10-02 00:57:38','',95,'http://localhost/wordpress/95-revision-v1/',0,'revision','',0),(97,1,'2018-10-02 07:58:10','2018-10-02 00:58:10','Lorem ipsum dolor a sit ameti, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et incididunt ut la